import React from 'react';
import Navigation from '../components/Navigation';
import BoutonAjoutServices from '../components/BoutonAjoutServices';
import BoutonSupprimerServices from '../components/BoutonSupprimerServices';
import BoutonFermeOuvert from '../components/BoutonFermeOuvert';
import BoutonCreerEmploye from '../components/BoutonCreerEmploye';
import BoutonSupprimerEmploye from '../components/BoutonSupprimerEmploye';
import { useState } from 'react';

const DashboardAdmin = () => {

    const [isOpen, setIsOpen] = useState(false);

    const isOpenAjout = () => {
        setIsOpen(true);
    }

    const isCloseAjout = () => {
        setIsOpen(false);
    }

    return (
        <div>
            <Navigation />
            <h1>Espace administration admin</h1>
            <div className="boutonDashboard">
                <BoutonSupprimerServices />
                <BoutonCreerEmploye />
                <BoutonSupprimerEmploye />
                <BoutonFermeOuvert />
            </div>
            {isOpen === false ?
                <button onClick={isOpenAjout}>Ajouter un service</button>
                :
                <button onClick={isCloseAjout}>Annuler</button>
            }

            {isOpen === false ?
                null
                :
                <BoutonAjoutServices />
            }

        </div>
    );
};

export default DashboardAdmin;
